social_posts.post_text:
@erb_jewerly really said “go big or go home” with this piece 😮‍💨

Now time for me to start manifesting one like this for my collection ✨😌✨

Not only does Ernest Roy Begay make incredibly beautiful pieces, him and his family are some of the NICEST people you’ll meet and I’m sooo grateful to call them friends 🥰 @rrb_originals @toweringhouse_jewelry 🤗

Is that a snake in my boot?! Nooo it’s the new @trixiecosmetics ‘Horse Girl’ eyeshadow palette 🐴🤠💅🏽✨

Created today’s makeup look using:
-Trixie Cosmetics ‘Horse Girl’ Palette
-Trixie Cosmetics ‘Show Pony’ Blush
-Trixie Cosmetics ‘Eden Liquid’ lipstick
(Used the Anastasia Beverly Hills lipliner in ‘Sandstone’ to line my lips ✨)

Jewelry worn:
@lv_nativedesigns bolo and belt buckle
@ahenibah.18 row bracelet cuffs
@tallis_creations coral and turquoise ring (teardrop shaped one)
@tonyajunerafael_jewelry coral and turquoise ring (oval shaped ring)
@wadsworthpiki tabs on gold hoops

📷: @t_glasses

When designing this clothing with @poloralphlauren I knew it had to be paired with jewelry that authentically represents what my family and I wear. So thrilled that we were able to uplift other Indigenous artists alongside my designs as the inaugural #RalphLauren Artist in Residence.

+ #RLArtistInResidence Jewelry +

We teamed up with six families and artists from the Navajo Nation, Hopi Pueblo, Zuni Pueblo, and San Felipé Pueblo. You can shop some jewelry that was featured in this campaign along with the clothing at the link in my bio.

